import React, { Component } from "react";
import SliderShow from "../components/SliderShow";
import { GridList, Grid, Button, CardMedia } from "@material-ui/core";
import "./Home.css";
import { Link } from "react-router-dom";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faHeart } from "@fortawesome/free-solid-svg-icons";

class Home extends Component {
  render() {
    return (
      <div className="home-container">
        <SliderShow />
        <img
          src={require("../images/Header_v2._CB1572630231_.jpg")}
          alt=""
          className="header-image"
        />
        <CardMedia
          className="header-image"
          style={{ margin: 10, height: 700 }}
          image={require("../images/Koolaburra-Hero-1x._CB1573602894_.jpg")}
        >
          <div>
            <Button
              className="shop-now"
              style={{
                color: "white",
                backgroundColor: "grey",
                fontWeight: "bold",
                justifyContent: "center",
                margin: "auto"
              }}
            >
              Mua sắm ngay
            </Button>
          </div>
        </CardMedia>
        <img
          src={require("../images/Mens_Sneakers._CB452515353_.jpg")}
          alt=""
          style={{ margin: 10 }}
          className="header-image"
        />
        <div>
          <span className="header-deals">Giảm giá sốc</span>
          <Grid container direction="row" style={{ justifyContent: "center" }}>
            {[1, 2, 3].map(t => (
              <Grid item>
                <img
                  src={require("../images/Featured1._CB449724364_.jpg")}
                  alt=""
                  style={{ margin: 10 }}
                  className="image-medium-large"
                />
                <div>
                  <span className="name-product-text">Giày ống của nữ</span>
                  <span className="sale-text">Giảm giá 30%</span>
                  <br />
                  <span className="cost-text">100.000 vnd</span>
                  <br />
                  <Button
                    className="shop-now "
                    style={{ textTransform: "none", fontWeight: "bold" }}
                  >
                    Mua ngay
                  </Button>
                </div>
              </Grid>
            ))}
          </Grid>
        </div>
        <div>
          <span className="header-deals">Bán chạy nhất</span>
          <Grid container direction="row" style={{ justifyContent: "center" }}>
            {[1, 2, 3, 3, 3, 3].map(t => (
              <div>
                <img
                  src={require("../images/75210475_1457858117712801_1937296649730636142_n.jpg")}
                  alt=""
                  style={{ margin: 10, maxWidth: 200 }}
                />
                <div>
                  <FontAwesomeIcon icon={faHeart} />
                  <span>200</span>
                </div>
                <div>
                  <span>Nike</span>
                  <br />
                  <span className="name-product-text">Ten san pham</span>
                  <br />
                  <span className="cost-text">100.000 vnd</span>
                </div>
              </div>
            ))}
          </Grid>
        </div>
        <div>
          <span className="header-deals">Sự kiện</span>
          <GridList
            cols={4}
            spacing={10}
            cellHeight={350}
            style={{ justifyContent: "center" }}
          >
            {[
              require("../images/Featured3._CB449724364_.jpg"),
              require("../images/73319948_547423299148143_3734155489720463253_n.jpg"),
              require("../images/71945322_2382749298656007_64044100865617627_n.jpg"),
              require("../images/74346777_712343609271482_2936742795323383430_n.jpg"),
              require("../images/73414154_2142882822675386_4132707914323506631_n.jpg"),
              require("../images/72880454_461648111129055_3511891921178023097_n.jpg"),
              require("../images/71538839_434384393891445_5109070227535552552_n.jpg"),
              require("../images/75210475_1457858117712801_1937296649730636142_n.jpg")
            ].map(imageUrl => (
              // <LinkTo href="https://www.facebook.com/events/giaythethaoonlinevn/event-sale-off-gi%E1%BA%A3m-gi%C3%A1-ch%C3%A0o-m%E1%BB%ABng-ng%C3%A0y-20-10/1723827307848787/">

              // </LinkTo>
              <img
                src={imageUrl}
                alt=""
                style={{ maxWidth: 330, marginTop: 10 }}
              />
            ))}
          </GridList>
        </div>
        <Link to="/login-or-register">
          <img
            src={require("../images/Email_Signup._CB1540327030_.png")}
            alt=""
            className="header-image"
            style={{ marginTop: 20, marginBottom: 20 }}
          />
        </Link>
      </div>
    );
  }
}

export default Home;
